import React, { useState } from "react";
import "./Category.css";
import PhoneIcon from "../assets/Phones.svg";

export default function () {
  const [count, setCount] = useState([1, 2, 3, 4, 5, 6, 7, 8, 9]);
  return (
    <div>
      <p>browse By Category</p>
      <div>
        {count.map(() => (
          <div className="category">
            <img src={PhoneIcon} />
            <p>Phones</p>
          </div>
        ))}
      </div>
    </div>
  );
}
